Create a Database : Use the following command to create the database: CREATE DATABASE library; Switch to the Database : Select the database to ensure subsequent commands apply to it: USE library; Create the Table : Define the books table with the specified schema: CREATE TABLE books ( id INT AUTO_INCREMENT PRIMARY KEY, title VARCHAR(255) NOT NULL, author VARCHAR(255) NOT NULL, published_year INT NOT NULL, genre VARCHAR(100)
); Explanation : id: Auto-increment ensures each record has a unique identifier. title, author: Strings of sufficient length to store book titles and author names. published_year: An integer for the year. genre: A string limited to 100 characters for the book's genre. Verify the Table Structure : Use the following command to inspect the table: DESCRIBE books; Insert Sample Data (Optional Extension) : Add three rows of data to the books table: INSERT INTO books (title, author, published_year, genre) VALUES
('To Kill a Mockingbird', 'Harper Lee', 1960, 'Fiction'),
('1984', 'George Orwell', 1949, 'Dystopian'),
('The Great Gatsby', 'F. Scott Fitzgerald', 1925, 'Classic'); Query to View Data : Retrieve all rows from the books table: SELECT * FROM books;

